import React from "react";
import profileImg from "../assets/images/front_bg.jpg";

function AboutMe() {
  return (
    <section id="aboutme">
      <h2>About Me</h2>
      <div className="aboutme-content">
        <img src={profileImg} alt="프로필" className="aboutme-img" />
        <div className="aboutme-text">
          <p>안녕하세요, 저는 프론트엔드 개발자 이재용입니다.</p>
          <p>
            사용자 중심의 UI/UX 설계와 효율적인 코드를 작성하는 것을 중요하게 생각하며,
            새로운 기술과 트렌드를 빠르게 학습하고 적용하는 것을 즐깁니다.
          </p>
          <p>
            다양한 프로젝트 경험을 통해 문제 해결 능력과 협업 능력을 쌓아왔습니다.
            앞으로도 지속적으로 성장하며 더 나은 서비스를 만드는 개발자가 되고 싶습니다.
          </p>
        </div>
      </div>
    </section>
  );
}

export default AboutMe;
